import React from 'react';

const Total = ({parts}) => {
    const totalExercises = parts.reduce(function(total, part) {
        return total + part.exercises
    }, 0)

    return (
        <p>total of {totalExercises} totalExercises</p>
    )
  }

  export default Total;
